import React from "react";
import "../../App.css";
import Footer from "../Footer";
import "../Cards.css";
import CardItem from "../CardItem";

export default function Services() {
  return (
    <div>
      {/* <h1 className="services">SERVICES</h1> */}
      <h1>Services</h1>
      <div className="cards__container">
        <div className="cards__wrapper">
          <ul className="cards__items">
            <CardItem
              src="https://media.istockphoto.com/videos/loading-symbol-loop-video-id547356494?s=640x640"
              text="Load new words onto the device with our service here"
              label="Custom Words & Images"
              path="/services"
            />
            <CardItem
              src="https://media.istockphoto.com/videos/loading-symbol-loop-video-id547356494?s=640x640"
              text="Upload the preloaded words and images for the device here"
              label="Preset Words & Images"
              path="/services"
            />
          </ul>
        </div>
      </div>
      <Footer />
    </div>
  );
}
